(241874, 4858, 'Lo que pude apreciar al momento de visitar al promotor, es que su vestimenta cumple con los puntos indicados en el cuadro anterior. AdemÃ¡s pude observar que tenÃ­a una buena presentaciÃ³n  personal e higiene. ', NULL, NULL, 131, NULL),
(241875, 4858, 'Al llegar al punto de venta el promotor se encontraba a la vista y en su puesto de trabajo, ademÃ¡s habÃ­an equipos reales, encendidos, limpios y ordenados y la gran mayorÃ­a exhibÃ­a sus precios.  ', NULL, NULL, 132, NULL),
(241876, 4858, 'El promotor al momento de acercarme no dejÃ³ de ocupar  su equipo personal, por el cual fui yo la que todo el tiempo tuve que hacer las preguntas sobre los equipos. Me pude dar cuenta de su amabilidad  y cortesÃ­a, pero no logrÃ³ convencerme ya que no hubo conexiÃ³n promotor - cliente.   ', NULL, NULL, 133, NULL),
