(241878, 4858, 'Al momento de llegar donde el promotor, Ã©l no se presenta, sÃ³lo responde al buenas tardes. \r\nLamentablemente el promotor no escucho muy bien mis necesidades al momento de la visita, ya que sÃ³lo me ofreciÃ³ lo mas econÃ³mico sin preguntarme las caracterÃ­sticas del equipo que buscaba. En realidad el promotor sÃ³lo responde a mis preguntas. ', NULL, NULL, 135, NULL),
(241879, 4858, 'El promotor tiene conocimientos de los productos de venta, pero no informa sobre garantÃ­as de la marca, ademÃ¡s sÃ³lo explica lo que uno consulta, no se explaya lo suficiente para que el cliente quede con la informaciÃ³n necesaria al momento de comprar un equipo samsung.  ', NULL, NULL, 136, NULL),
(241880, 4858, 'El promotor consta con la vestimenta adecuada que dicta la marca, no usa accesorios adicionales y tiene su credencial visible al momento de la visita.  ', NULL, NULL, 137, NULL),
(241881, 4858, 'El promotor consta con la claridad y el tono necesario para poder atender a los clientes, pero al momento de hablar con Ã©l no realiza un contacto visual adecuado lo que impide la confianza al momento de comprar la marca. ', NULL, NULL, 138, NULL),
(241882, 4858, 'Al momento de la visita, el promotor me invita a ver los equipo, pero en ningÃºn momento Ã©l manipula los productos para explicar como se utiliza ni da consejos de uso. ', NULL, NULL, 139, NULL),
(241883, 4858, 'El promotor si sabia cuales eran los modos de pago de la tienda ya que me indica como puedo pagar en caso de la venta. ', NULL, NULL, 140, NULL),
(241884, 4858, 'Yo si comprarÃ­a el producto samsung, sÃ³lo porque conozco la marca y me da confianza, pero al momento de ser atendida por el promotor no me deja muy conforme ya que encuentro que su atenciÃ³n fue regular por lo expuesto anteriormente.    ', NULL, NULL, 141, NULL),
