(245970, 4876, 'El promotor al momento de la visita usaba polera y pantalÃ³n de la marca samsung, no usaba chaqueta, la vestimenta posee logo, el promotor solo usaba su uniforme y nada adicional a el.  ', NULL, NULL, 131, NULL),
(245971, 4876, 'El promotor se encontraba a la vista al momento de llegar a la tienda, los productos en demostraciÃ³n se encontraban limpios y con su precio a la vista, el punto estaba ordenado y  los equipos se encontraban prendidos.  ', NULL, NULL, 132, NULL),
(245972, 4876, 'El promotor al notar mi presencia dejÃ³ de hacer lo que estaba haciendo para abordarme, el promotor se encontraba desocupado al momento de la visita, muestra cortesÃ­a y entusiasmo al atenderme.  ', NULL, NULL, 133, NULL),
(245973, 4876, 'Es capas de contra argumentar  para promover los beneficios samsung.  ', NULL, NULL, 134, NULL),
(245974, 4876, 'El promotor da la bienvenida pero no da su nombre, escucha mis necesidades, realiza preguntas para detectar mis necesidades, logra identificar mis necesidades.  ', NULL, NULL, 135, NULL),
(245975, 4876, 'El promotor en algunos momentos no explicaba de manera sencilla y clara los beneficios de los productos de la marca samsung, demuestra tener conocimientos de los productos samsung, informa sobre la garantÃ­a del producto de la marca, no ofrece producto de valor superior al cotizado.  ', NULL, NULL, 136, NULL),
(245976, 4876, 'La imagen del promotor es ordenada y limpia, no posee uniforme completo hace falta la chaqueta, la credencial se encuentra a la vista pero estaba volteada, el vendedor solo usa su uniforme y nada adicional a el.  ', NULL, NULL, 137, NULL),
(245977, 4876, 'Habla con claridad y buen tono, hizo contacto visual conmigo para establecer  una relaciÃ³n, recomienda con confianza la marca samsung.   ', NULL, NULL, 138, NULL),
(245978, 4876, 'No demuestra si sabe manipular los productos samsung, no demuestra si es capaz de entrar al menÃº, no realiza demostraciones para explicar algunos atributos, no invita a probar los productos, no explica como utilizar el producto, los productos no eran maquetas se encontraban prendidos solo dio las caracterÃ­sticas.   ', NULL, NULL, 139, NULL),
(245979, 4876, 'El promotor posee conocimientos de las formas de pago disponibles que hay en la tienda, no ofrece  ni un producto complementario. ', NULL, NULL, 140, NULL),
(245980, 4876, 'De acuerdo a la atenciÃ³n recibida por parte del promotor si considerarÃ­a comprar un producto en samsung, en general la atenciÃ³n fue buena.  ', NULL, NULL, 141, NULL),
