(246559, 4806, 'El promotor explica de forma sencilla y clara los beneficios de los productos y de la  marca, el promotor demuestra tener conocimientos de los productos en algunos momentos, no informa sobre la garantÃ­a del producto otorgado, el vendedor ofrece un producto de valor superior al cotizado. ', NULL, NULL, 136, NULL),
