(247619, 4812, 'El promotor a evaluar se encontraba a la vista al momento de llegar al punto de venta, los productos en demostraciÃ³n se encontraban limpios y con su precio a la vista, el punto de venta estÃ¡ ordenado y los equipos se encontraban prendidos.  ', NULL, NULL, 132, NULL),
