(6, 9, 45, 4, '2014-04-12', 2, 2, '6_2014-04-12_chw vespucio.jpg', 'La experiencia de esta visita en general fue muy agradable pero el empleado que atiende en caja deberÃ­a ser mÃ¡s atento para el cierre y despedida del servicio, ademÃ¡s todos los empleados deberÃ­an usar sus gafetes. ', 'MenÃº Libre con tope de $3.800'),
(7, 7, 50, 4, '2014-04-17', 2, 2, '7_2014-04-20_cw costanera center.jpg', 'en general, una muy buena experiencia. los felicito. este es uno de los locales con mejor atenciÃ³n y producto de los que he visitado.\r\nme gustarÃ­a destacar que ofrecen en todos los menÃºs verduras salteadas, en vez de los wantan que ofrecen los demÃ¡s locales que he visitado.', 'MenÃº Libre con tope de $3.800'),
(8, 7, 46, 4, '2014-04-09', 2, 2, '8_2014-04-10_cw b66.jpg', 'En general, esta visita cumnple con todos los tÃ³picos a evaluar. Buen producto, gran calidad de atenciÃ³n y rapidez.\r\nQuizÃ¡s lo Ãºnico criticable es el tema de la mÃ¡quina de cafÃ©. Pero fue una grata experiencia. Felicitaciones.', 'MenÃº Libre con tope de $3.800'),
(9, 7, 41, 4, '2014-04-09', 2, 2, '9_2014-04-10_cw mall plaza alameda.jpg', 'En general, me fui contenta del local. Fue una grata y rÃ¡pida experiencia. Pero creo que Claudio deberÃ­a disfrutar mÃ¡s del momento en que interactÃºa con el cliente.', 'MenÃº Libre con tope de $3.800'),
(10, 9, 43, 4, '2014-04-05', 2, 2, '10_2014-04-06_IMG-20140406-WA0000.jpg', 'En general una buena visita, si debo informar que la caja registradora esta desconfigurada la hora no corresponde a la hora de compra.', 'MenÃº Libre con tope de $3.800'),
(11, 9, 51, 4, '2014-04-05', 2, 2, '11_2014-04-05_IMG-20140405-WA0006.jpg', 'Local cerrado hay un letrero seÃ±alando que esta en mantenciÃ³n.', 'MenÃº Libre con tope de $3.800'),
(12, 20, 49, 4, '2014-04-11', 2, 2, '12_2014-04-12_2014-04-12 19.33.11.jpg', 'Si bien, la comida y la actitud del personal fue agradable, me pareciÃ³ extraÃ±o el hecho de que estuviesen cerrando tan temprano, ya que eran las 18:36...  no quedaba mucha comida, personalmente le pregunte al cajero a que hora cerraban y me dijo a las 8', 'MenÃº Libre con tope de $3.800'),
(13, 17, 47, 4, '2014-04-15', 2, 2, '13_2014-04-15_DSC_1042.jpg', 'En esta visita rescatare el sabor de la comida y la atenciÃ³n recibida por el cajero.Felicitaciones su camisa bien planchada.', 'MenÃº Libre con tope de $3.800'),
